// HomePage.js

// HomePage.js

import React from 'react';
import './HomePage.css';

const HomePage = () => {
  return (
    <div className="container">
      {/* Header */}
      <header className="header">
      <div className="logo-container">
          <img src="/path/to/your/logo.png" alt="Company Logo" className="logo" />
          <h1 className="company-name">Auction Platform</h1>
        </div>
        <div className="user-container">
          <img src="src\img\user-solid.svg" alt="User Icon" className="user-icon" />
          <div className="user-options">
            <span className="user-option">Logout</span>
            <span className="user-option">Settings</span>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <section className="main-content">
        {/* Your main content goes here */}
        <h2>Welcome to Auction Platform</h2>
        <p>Your destination for exciting bidding!</p>
      </section>

      {/* Footer */}
      <footer className="footer">
      <p className="footer-text">Auction Hub &copy; 2024</p>
        <p className="footer-text"><strong>Your Company Name</strong></p>
      </footer>
    </div>
  );
};

export default HomePage;
